//import styles from "./App.module.css";
import BugFound from "./BugFound";
import { useState } from "react";
import ComputerScreen from "./ComputerScreen";

function App() {
  const [isScreen, setScreen] = useState(false);

  const handleGoNext = () => {
    setScreen(true);
    console.log("clicked");
  };

  return (
    <>
      {isScreen ? (
        <ComputerScreen />
      ) : (
        <BugFound onClickAnywhere={handleGoNext} />
      )}
    </>
  );
}

export default App;
